// generateData.js

const fs = require('fs');

function generateData() {
  const data = {
    nodes: [],
    links: []
  };

  // 添加主节点
  data.nodes.push({ id: '主节点', group: 0, isMain: true, relatedness: 1 });

  // 自动生成其他节点和链接
  for (let i = 1; i <= 100; i++) { // 生成100个节点
    const relatedness = Math.random(); // 关联度为随机值
    data.nodes.push({ 
      id: `Node ${i}`, 
      group: 1, 
      isMain: false, 
      relatedness 
    });

    // 每个节点都与主节点连接
    data.links.push({
      source: '主节点',
      target: `Node ${i}`
    });

    // 随机连接节点以创建额外的链接
    const targetIndex = Math.floor(Math.random() * i) + 1;
    if (targetIndex !== i) { // 避免自连接
      data.links.push({
        source: `Node ${i}`,
        target: `Node ${targetIndex}`
      });
    }
  }

  return data;
}

const graphData = generateData();
fs.writeFileSync('data.json', JSON.stringify(graphData, null, 2));
